def clean_price(price_str):
    if pd.isna(price_str):
        return np.nan
    price_str = str(price_str).split('-')[0].strip()
    price_str = price_str.replace('$', '').replace('.', '').replace(',', '.').strip()
    try:
        val = float(price_str)
        return val
    except ValueError:
        return np.nan

